color = {}

function onDropped(player_color)
    local rotations = {0, 1, 0, 1}
    color = player_color
    local params = {playerColor=player_color, breachTable=rotations}
    Global.call('dealBreaches', {playerColor=player_color, breachTable=rotations})
     local magePositions = Global.call('getMagePositions', {playerColor=player_color})

    self.takeObject({guid = 'bf7c9c', position = magePositions['hand'], callback = 'drww'})
    self.takeObject({guid = '06a321', position = magePositions['board'], rotation = {0, 180, 0}})
    self.takeObject({guid = 'c1a17e', position = magePositions['deck'], rotation = {0, 180, 180} })
    self.destruct()
end

function drww()
    getObjectFromGUID('bf7c9c').dealToColor(5, color)
end

